import React from 'react';
import { 
  Navigate,
  createBrowserRouter,
  RouterProvider,
  Outlet
} from 'react-router-dom';
import { useAuth } from './context/AuthContext';
import { CartProvider } from './context/CartContext';
import { WishlistProvider } from './context/WishlistContext';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './pages/Home';
import Books from './pages/Books';
import BookDetails from './pages/BookDetails';
import Cart from './pages/Cart';
import Checkout from './pages/Checkout';
import Profile from './pages/Profile';
import Login from './pages/Login';
import Register from './pages/Register';
import OrderTracking from './pages/OrderTracking';
import OrderHistory from './pages/OrderHistory';
import Dashboard from './pages/admin/Dashboard';
import AdminBooks from './pages/admin/Books';
import AdminOrders from './pages/admin/AdminOrders';
import AdminUsers from './pages/admin/AdminUsers';
import Wishlist from './pages/Wishlist';
import About from './pages/About';
import Author from './pages/Author';
import NotFound from './pages/NotFound';
import './App.css';

// Layout component that includes Navbar and Footer
const Layout = () => {
  const { user, isAuthenticated, logout } = useAuth();
  
  return (
    <div className="app">
      <Navbar 
        isAuthenticated={isAuthenticated}
        user={user}
        onLogout={logout}
      />
      <main className="main-content">
        <Outlet />
      </main>
      <Footer />
    </div>
  );
};

function App() {
  const router = createBrowserRouter([
    {
      path: "/",
      element: <Layout />,
      children: [
        {
          index: true,
          element: <Home />
        },
        {
          path: "books",
          element: <Books />
        },
        {
          path: "books/:id",
          element: <BookDetails />
        },
        {
          path: "cart",
          element: <ProtectedRoute><Cart /></ProtectedRoute>
        },
        {
          path: "checkout",
          element: <ProtectedRoute><Checkout /></ProtectedRoute>
        },
        {
          path: "profile",
          element: <ProtectedRoute><Profile /></ProtectedRoute>
        },
        {
          path: "login",
          element: <PublicRoute><Login /></PublicRoute>
        },
        {
          path: "register",
          element: <PublicRoute><Register /></PublicRoute>
        },
        {
          path: "tracking",
          element: <ProtectedRoute><OrderTracking /></ProtectedRoute>
        },
        {
          path: "orders",
          element: <ProtectedRoute><OrderHistory /></ProtectedRoute>
        },
        {
          path: "admin",
          element: <AdminRoute><Dashboard /></AdminRoute>
        },
        {
          path: "admin/books",
          element: <AdminRoute><AdminBooks /></AdminRoute>
        },
        {
          path: "admin/orders",
          element: <AdminRoute><AdminOrders /></AdminRoute>
        },
        {
          path: "admin/users",
          element: <AdminRoute><AdminUsers /></AdminRoute>
        },
        {
          path: "wishlist",
          element: <ProtectedRoute><Wishlist /></ProtectedRoute>
        },
        {
          path: "about",
          element: <About />
        },
        {
          path: "author/:authorName",
          element: <Author />
        },
        { path: '*', element: <NotFound /> }
      ]
    }
  ], {
    future: {
      v7_startTransition: true
    }
  });

  return (
    <AuthProvider>
      <CartProvider>
        <WishlistProvider>
          <RouterProvider router={router} />
        </WishlistProvider>
      </CartProvider>
    </AuthProvider>
  );
}

// Protected Route Component
const ProtectedRoute = ({ children }) => {
  const { isAuthenticated, loading } = useAuth();
  
  if (loading) {
    return (
      <div className="loading">
        <div className="loading-spinner"></div>
      </div>
    );
  }
  
  return isAuthenticated ? children : <Navigate to="/login" replace />;
};

// Public Route Component (redirects to profile if already authenticated)
const PublicRoute = ({ children }) => {
  const { isAuthenticated, loading } = useAuth();
  
  if (loading) {
    return (
      <div className="loading">
        <div className="loading-spinner"></div>
      </div>
    );
  }
  
  return isAuthenticated ? <Navigate to="/profile" replace /> : children;
};

// Admin Route Component
const AdminRoute = ({ children }) => {
  const { isAuthenticated, user, loading } = useAuth();
  
  if (loading) {
    return (
      <div className="loading">
        <div className="loading-spinner"></div>
      </div>
    );
  }
  
  return isAuthenticated && user?.role === 'admin' ? children : <Navigate to="/login" replace />;
};

export default App;
